data: {"id":"91b04bd0-f9c5-45db-bba5-5bceaf0c2bfc","model":"gpt-35-turbo","created":1703013135,"object":"extensions.chat.completion.chunk","choices":[{"index":0,"delta":{"context":{"messages":[{"role":"tool","content":"{\"citations\":[{\"content\":\"<h2 id=\\\"ai-cognitive-services-sdk-releases\\\">AI Cognitive Services SDK Releases</h2>\\n<ul>\\n<li>\\\"When's the next release?\\\"</li>\\n<li>\\\"How long is there left to get this change in?\\\"</li>\\n<li>\\\"When did we release that old version?\\\"</li>\\n</ul>\\n<h3 id=\\\"current-in-development-release\\\">Current, in-development release</h3>\\n<table>\\n<thead>\\n<tr>\\n<th>Sprint Label</th>\\n<th>Version - Speech</th>\\n<th>Version - Vision</th>\\n<th>All PRs out</th>\\n<th>Release by</th>\\n<th>Notes</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>202301</td>\\n<td>1.25.0</td>\\n<td>0.7</td>\\n<td>Fri Jan 13</td>\\n<td>Fri Jan 27</td>\\n<td></td>\\n</tr>\\n</tbody>\\n</table>\\n<p><strong>\\\"PR complete\\\" and \\\"release by\\\"</strong></p>\\n<p>We generally talk about two dates when it comes to upcoming releases:</p>\\n<ul>\\n<li><strong>PR complete</strong> or <strong>\\\"all PRs out by\\\"</strong>: this is the date when all pull requests that are intended to be part of the release should be functionally complete and out for review. It's OK if it still needs a few updates, but expectations on pending PRs should be that they'll wrap up within a business day or two. This is what's tracked in our sprints.</li>\\n<li><strong>Release</strong> or <strong>\\\"release by\\\"</strong>: This is roughly the \\\"P95\\\" estimate for the latest the publicly-available release packages are published and available under the assumption that the corresponding PR complete date holds. This is an <em>estimate</em> that's intended to be conservative -- most releases happen before the projected date, but <strong>release is always gated by readiness</strong> and it's possible for things to get postponed. Estimated release dates may be communicated to customers, but only with the clarification that it's a target and not a guarantee.</li>\\n</ul>\\n<p>The single \\\"source of truth\\\" for the SDK's \\\"PR complete\\\" date is the sprint definition on Azure DevOps: <a href=\\\"https://msasg.visualstudio.com/Skyman/_sprints/taskboard/Carbon%20Team/Skyman/Carbon/\\\">https://msasg.visualstudio.com/Skyman/_sprints/taskboard/Carbon%20Team/Skyman/Carbon/</a></p>\\n<p>See the sprint date range definition in the upper right, e.g.:</p>\\n<p><img alt=\\\"image\\\" src=\\\"https://media.microsoft.ghe.com/user/5475/files/00c74e6f-de09-45dc-ae56-2954ee12006d\\\" /></p>\\n<p>\\\"Release by\\\" dates, meanwhile, are generally estimated at about two weeks past PR complete -- time enough for in-flight PRs to wrap up, release candidates to be built and validated across all languages/environments, documentation and other external repository resources to be staged, and bits to be published.</p>\\n<p>The dates here are replicated for convenience and history. This may not always be entirely up to date; please check the sprint board above or contact the team (cdev) if anything's unclear!</p>\\n<h3 id=\\\"release-planning\\\">Release planning</h3>\\n<p><a href=\\\"./planning.md\\\">SDK planning -- Wiki</a></p>\\n<h3 id=\\\"release-signoff\\\">Release signoff</h3>\\n<p><a href=\\\"https://microsoft.sharepoint.com/teams/Carbon2/_layouts/OneNote.aspx?id=%2Fteams%2FCarbon2%2FSiteAssets%2FCarbon%20Notebook&amp;wd=target%28Release.one%7C47758B05-9653-4BA3-B15F-0737A0AB5880%2F%29\\\">SDK release process -- OneNote</a></p>\",\"id\":null,\"title\":\"AI Cognitive Services SDK Releases\",\"filepath\":\"release.md\",\"url\":\"https://openaisdktestdatastorage.blob.core.windows.net/fileupload-azure_search_index/release.md\",\"metadata\":{\"chunking\":\"orignal document size=1000. Scores=6.6608486Org Highlight count=30.\"},\"chunk_id\":\"0\"},{\"content\":\"<p>Compile Carbon</p>\\n<p>To compile source code and build carbon executables, do the following (you do not need administrator privileges for this):</p>\\n<ul>\\n<li>Using Visual Studio:</li>\\n<li>Open <code>carbon.sln</code> in your build folder (e.g. <code>c:\\\\src\\\\carbon\\\\build</code>)</li>\\n<li>\\n<p>Build using Visual Studio. All your nuget packages will be automatically restored</p>\\n</li>\\n<li>\\n<p>Using cmake from the command line:</p>\\n</li>\\n<li>Open up a command prompt</li>\\n<li>Navigate to your build folder e.g. <code>pushd c:\\\\src\\\\carbon\\\\build</code></li>\\n<li>Restore the needed Nuget packages: <code>nuget restore</code></li>\\n<li>You only need to run this the first time, or after a pull from master </li>\\n<li>\\n<p>Build the configuration you'd like:</p>\\n<ul>\\n<li>Debug: <code>cmake --build . -- -maxcpucount:4</code></li>\\n<li>Release: <code>cmake --build . --config Release -- -maxcpucount:4</code></li>\\n<li>NOTE: The flag <code>-- -maxcpucount:4</code> instructs CMake to use 4 \\\"CPU\\\"s the build to speed things up(the space between the first two and the third dash is intentional). You can replace 4 with %NUMBER_OF_PROCESSORS% to use all available processors though this may make you machine unresponsive</li>\\n<li><a href=\\\"https://cmake.org/cmake/help/latest/manual/cmake.1.html#build-a-project\\\">See here</a> for more information on building with cmake.</li>\\n</ul>\\n</li>\\n<li>\\n<p>Using msbuild from the command line:</p>\\n</li>\\n<li>Run the \\\"x64 Native Tools Command Prompt for VS 2022\\\" from your Start Menu (use the x86 one if building 32 bit)</li>\\n<li>Navigate to your build folder e.g. <code>c:\\\\src\\\\carbon\\\\build</code></li>\\n<li>Restore the needed Nuget packages: <code>nuget restore</code><ul>\\n<li>You only need to run this the first time, or after a pull from master</li>\\n</ul>\\n</li>\\n<li>Build the configuration you'd like<ul>\\n<li>Debug: <code>msbuild carbon.sln</code></li>\\n<li>Release: <code>msbuild /p:Configuration=Release carbon.sln</code></li>\\n<li>Got a fast machine? Add the <code>/m</code> flag to enable project level parallelization for even faster builds</li>\\n</ul>\\n</li>\\n</ul>\",\"id\":null,\"title\":\"Checkout and Build Carbon on Windows\",\"filepath\":\"setupwinenv.md\",\"url\":\"https://openaisdktestdatastorage.blob.core.windows.net/fileupload-azure_search_index/setupwinenv.md\",\"metadata\":{\"chunking\":\"orignal document size=707. Scores=0.84229267Org Highlight count=18.\"},\"chunk_id\":\"3\"}],\"intent\":\"[\\\"What is the most common feedback customers give about our product?\\\", \\\"What do customers say about our product?\\\", \\\"What are the common complaints or compliments about our product?\\\", \\\"What are the most frequent comments from customers about our product?\\\", \\\"What are the most common customer reviews about our product?\\\", \\\"What are the most common customer feedback about our product?\\\", \\\"What do customers think about our product?\\\", \\\"What are the most common opinions of customers about our product?\\\", \\\"What are the most common things customers say about our product?\\\", \\\"What are the most common customer experiences with our product?\\\", \\\"What\\\"]\"}","end_turn":false}]}},"end_turn":false,"finish_reason":null}]}

